import React from 'react'
import './App.css';

import deliverizelogo1 from '../src/imgs/deliverizelogo1.png';
import deliverizelogo2 from '../src/imgs/deliverizelogo2.png';
import icone1 from '../src/imgs/icones/icone1/account_circle_24px.png';
import icone2 from '../src/imgs/icones/icone2/shopping_cart_24px.png';
import icone3 from '../src/imgs/icones/icone3/Ellipse 10.png';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <nav>
          <div className="nav__logo1"><img src={deliverizelogo1} /></div>
          <div className="nav__logo2"><img src={deliverizelogo2} /></div>
          <div className="nav__background">
            <h1 className="nav__background_entrega">Entrega</h1>
            <h1 className="nav__background_endereco">R: Antonie Braune, 222</h1>
          </div>
          <form>
            <input className="nav__inputplaceholder" type="text" placeholder=" Busque por estabelecimento ou produtos"></input>
          </form>
        </nav>
        <div className="nav__icone1"><img src={icone1} /></div>
        <div className="nav__icone2"><img src={icone2} /></div>
        <div className="nav__ico2part2"><img src={icone3} /></div>
        <ul>
          <li class="nav__link1"><a href="#">Entrar</a></li>
          <li class="nav__link2"><a href="#">Carrinho</a></li>
          <li class="nav__link3"><a href="#">1</a></li>
        </ul>
      </header>
    </div>
  );
}

export default App;
